import React from "react";
import {useTheme} from "@material-ui/core";
import Grid from "@material-ui/core/Grid";

const HomePage = () => {
    const theme = useTheme()

    return (
        <Grid container justify="center" alignItems="center"
              style={{color: theme.palette.text.primary, paddingTop: "50px"}}>
            <Grid item xs={6}> This is simple platform game created using phaser3 javaScript game engine. The goal of
                this
                project was to learn building games. I create this game using free assets from <a
                    href="https://www.kenney.nl/">www.kenney.nl</a> and 
                <a href="https://craftpix.net/">www.craftpix.net</a>.
            </Grid>
        </Grid>
    )
}
export default HomePage;
